INSERT INTO `astrologer_profile_boosts` (`id`, `chat_commission`, `call_commission`, `video_call_commission`, `profile_boost_benefits`, `profile_boost`, `created_at`, `updated_at`) VALUES
(1, 50, 50, 50, '[\"Profile boosting ensures that astrologers appear at the top of search results or listings, leading to higher visibility among potential clients.\",\"With higher visibility, astrologers are likely to get more clicks, profile views, and inquiries from users looking for consultations.\",\"Increased visibility often translates into more bookings for consultations, which can lead to better earnings for the astrologers.\",\"Being featured prominently can enhance an astrologer\'s credibility, making them appear more authoritative and experienced in the eyes of potential clients.\"]', 11, '2025-06-25 13:28:53', '2025-09-30 13:55:07');
